import React from 'react';

class ContactPage extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            name: '',
            email: '',
            message: '',
            disabled: false,
            emailSent: null,
        }
    }

    render() {
        return (
            <p>My Contact Page</p>
        );
    }

}

export default ContactPage;
